class FunctionResult(OfficeExtension.ClientObject):
    # Begin_PlaceHolder_FunctionResult_Custom_Members
    # End_PlaceHolder_FunctionResult_Custom_Members
    def __init__(self, context: OfficeExtension.ClientRequestContext, objectPath: OfficeExtension.ObjectPath):
        super(self.__class__, self).__init__(context, objectPath)
        self._error = None
        self._value = None


    @property
    def error(self) -> 'str':
        _loadIfInstantSyncExecutionMode(self, "error", self._error)
        _throwIfNotLoaded("error", self._error, "FunctionResult", self._isNull)
        return self._error
    

    @property
    def value(self) -> 'any':
        _loadIfInstantSyncExecutionMode(self, "value", self._value)
        _throwIfNotLoaded("value", self._value, "FunctionResult", self._isNull)
        return self._value
    

    # Handle results returned from the document
    def _handleResult(self, value: dict) -> None:
        super(self.__class__, self)._handleIdResult(value)
        if _isNullOrUndefined(value):
            return
        obj = value;
        if "Error" in obj:
            self._error = obj.get("Error")
        if "Value" in obj:
            self._value = obj.get("Value")
    
    def load(self, option = None) -> 'FunctionResult':
        _load(self, option)
        return self
    
    def reload(self) -> 'FunctionResult':
        _load(self, None)
        return self

